import React, {Component} from 'react';

class NavBar extends Component {
    menuClick = () =>{
        if(document.getElementById('nav').contains("menuClose")){
        document.getElementById('nav').classList.remove("menuClose");
        document.getElementById('nav').classList.add("menuOpen");
        document.getElementById('nav').classList.remove("footerClose");
        document.getElementById('nav').classList.add("footerOpen")
        } else {
            console.log('ok');
        }
    }
    render() {
        return (
            <div>
                <div className="navBar">
                    <div className="navLeft">
                        <img src="#" alt="profile photo"/>
                    </div>
                    <div className="navRight">
                        <img onClick={this.menuClick} src={require('../images/menu-ico.png')} alt="nav ico"/>
                    </div>
                </div>
                <div id="nav" className="menuContent menuClose footerClose">
                    <p><a href="#">Create Account</a></p>
                    <p><a href="#">Log in</a></p>
                </div>
            </div>

        );
    }
}

export default NavBar;
